        "bio": "native of oakland california, was born and raised on 60th ave in oakland, watch dog whisperer, wife is a co-paster her name is Prophetise Mavis Franklin, had a son who passed away in a car crash would have been 24, daughter who&#39;s 18 who grad high school. In 2007 the lord told me, &quot;bryan tell my people I love them, tell my people I died for them, my message is still love&quot; - this is the core of my personal mission and ministry. Was ordained of Abundant Life New generation ministries in Oakland in 2004. The lord gave him the name of the church, <br />rededicated life to the lord in 2001, lord began to piece together everything for the start of this church. One of the pieces was the name of the church &quot;latter rain&quot;, &quot;the sun shines of the beautiful latter rain that commeth against my window payne&quot;. <br /><br />married in 2005. <br /><br />pieces that began to fall in place like a thread. He began to reveal his heart and show me what he wanted me to do. <br />I&#39;m working on a worship cd in the key of rhema, play the acoustic guitar and piano and all the arrangements god gave to me. <br /><br />started this church in his living room. I feel this is the birthing time, I know god is bringing in the harvest. <br /><br />used to work at summet medical center in environmental services, god tole him to leave his job in 2005 and sent him 2000 miles to minister to one soul. I wasn&#39;t even married. all my earthly possessions were in my car and trusted the lord. When I left my job, my wife manifested. I never knew my grandfather all I had was his name. I knew the lord had told me to go to little rock Arkansas. on the way I met my grandfather for the very first time and many of his relatives. left after a few days to little rock Arkansas, walked through double doors of this hotel was immediately refreshed, was lord allowed me to lay hands on this lady had brain tumor, and the lord healed her and the holy spirit revealed it to him that he healed her I felt the lord touch that lady. He wanted to show me how much he loved his people and the importance about what real ministry is about. If love isn&#39;t at the center, it&#39;s empty and vague.  <br /><br />I thought I was in arkansaw to plant a church<br />in 2007 i had an open vision that little eagles coming from n,s,e,w, and converged on a concrete platform began to metamorph until became one massive bird, the color looked like it was living - the eagle is the symbol for his church. Isiah 40:28-31 - represents the chosen the elect, the freshness, the body of Christ, the true church.  a surrendered heart. a renewed strength, the restoration of the church. <br /><br />Wrote book &quot;cover to cover&quot; 2012 -  genesis to revelation god&#39;s 21st century of the church, about restoration the love of god. empasulates the love of jesus christ. The lord game him the title of the book only for 8 months, then got the lighting bolt of inspiration and couldn&#39;t stop writing, finished it in four days.",
